  true,\n\t\"url\": null,\n\t\"notes\": \"The NIST Computational Chemistry Comparison
  and Benchmark Database is a collection of experimental and ab initio thermochemical
  properties for a selected set of gas-phase molecules. The goals are to provide a
  benchmark set of experimental data for the evaluation of ab initio computational
  methods and allow the comparison between different ab initio computational methods
  for the prediction of gas-phase thermochemical properties. The data here is a subset
  of just the experimental data present in the CCCBDB and none of the computed data.\",\n\t\"license_title\":
